import { createSlice } from "@reduxjs/toolkit";
import User from "../../../../Backend/Models/User";

const initialState={
    error:null,
    isLoading:false,
    user:null,
    isloggedIn:false
}
const userSlice=createSlice({
    name:User,
    initialState,
    reducers:{
        loignStart:(state)=>{
            state.isLoading=true

        },
        login
    }

})
